class EmailAuthBackend:
    """
    Consolidated authentication backend.

    The single ``authenticate`` method can work with both the default Django
    ``User`` model and the custom ``Provider`` model.  It also provides a
    password‑less lookup (``auth_email``) that mirrors the previous
    ``auth_email``/``auth_email2`` methods.

    Parameters
    ----------
    username : str
        Email address used for lookup.
    password : str, optional
        Plain‑text password to verify.  If omitted, the method returns the
        user object without checking a password.
    model : str, optional
        Target model for authentication. Accepted values are ``'django'`` for
        ``django.contrib.auth.models.User`` and ``'provider'`` for the custom
        ``Provider`` model.  Defaults to ``'django'``.
    """

    def _fetch_user(self, username: str, target_model):
        """
        Retrieve a user instance from the appropriate model.

        For the Django ``User`` model we perform an exact email match.
        For the ``Provider`` model we look up the related ``User`` via the
        ``idUser__mail`` field (maintaining the original ``contains`` behaviour).

        Raises
        ------
        target_model.DoesNotExist
            If no matching record is found.
        """
        if target_model is django_User:
            return django_User.objects.get(email=username)
        else:  # Provider
            return Provider.objects.filter(idUser__mail__contains=username).first()

    def authenticate(self, username=None, password=None, model='django'):
        """
        Authenticate a user against the selected model.

        Returns the user instance on success, otherwise ``None``.
        """
        if not username:
            return None

        # Resolve the target model
        target_model = django_User if model == 'django' else Provider

        try:
            user = self._fetch_user(username, target_model)

            # ``user`` can be ``None`` for Provider when the filter returns no result
            if not user:
                return None

            # If a password is supplied, verify it; otherwise just return the user
            if password is not None:
                if check_password(password, user.password):
                    return user
                return None
            else:
                return user

        except (django_User.DoesNotExist, Provider.DoesNotExist, Exception):
            # Any lookup or unexpected error results in a ``None`` return,
            # mirroring the original backend behaviour.
            return None

    # Backward‑compatible wrappers (optional, kept for existing imports)
    def authenticate2(self, username=None, password=None):
        """Legacy wrapper for Provider authentication."""
        return self.authenticate(username=username, password=password, model='provider')

    def auth_email(self, username=None):
        """Legacy wrapper for Provider email lookup without password."""
        return self.authenticate(username=username, password=None, model='provider')

    def auth_email2(self, username=None):
        """Legacy wrapper for Django email lookup without password."""
        return self.authenticate(username=username, password=None, model='django')


