#! /usr/bin/env python
# encoding: utf-8
# WARNING! Do not edit! http://waf.googlecode.com/git/docs/wafbook/single.html#_obtaining_the_waf_file

import os, shlex, shutil, traceback, errno, sys, stat
from waflib import Utils, Configure, Logs, Options, ConfigSet, Context, Errors, Build, Node

build_dir_override = None
no_climb_commands = ['configure']
default_cmd = "build"


# ----------------------------------------------------------------------
# Helper functions for waf_entry_point – they isolate distinct pieces of
# logic making the main entry point easier to read and maintain.
# ----------------------------------------------------------------------
def _check_waf_version(expected_version):
    """Abort if the running library version does not match the script version."""
    if Context.WAFVERSION != expected_version:
        Logs.error(
            'Waf script %r and library %r do not match (directory %r)' %
            (expected_version, Context.WAFVERSION, Context.waf_dir)
        )
        sys.exit(1)


def _handle_version_argument(current_directory):
    """If '--version' is present on the command line, print the version and exit."""
    if '--version' in sys.argv:
        Context.run_dir = current_directory
        ctx = Context.create_context('options')
        ctx.curdir = current_directory
        ctx.parse_args()
        sys.exit(0)


def _determine_no_climb():
    """Return True if the directory walk should stop after the first level."""
    no_climb = os.environ.get('NOCLIMB', None)
    if not no_climb:
        for k in no_climb_commands:
            if k in sys.argv:
                no_climb = True
                break
    return bool(no_climb)


def _load_lockfile(cur):
    """Try to load a lockfile from *cur* and set the global run/top/out dirs."""
    env = ConfigSet.ConfigSet()
    try:
        env.load(os.path.join(cur, Options.lockfile))
        ino = os.stat(cur)[stat.ST_INO]
    except Exception:
        return False

    load = False
    for x in [env.run_dir, env.top_dir, env.out_dir]:
        if Utils.is_win32:
            if cur == x:
                load = True
                break
        else:
            try:
                ino2 = os.stat(x)[stat.ST_INO]
            except OSError:
                continue
            else:
                if ino == ino2:
                    load = True
                    break

    if not load:
        Logs.warn('invalid lock file in %s' % cur)
        return False

    Context.run_dir = env.run_dir
    Context.top_dir = env.top_dir
    Context.out_dir = env.out_dir
    return True


def _find_run_directory(start_dir):
    """Walk up the directory tree to locate the project root (run_dir)."""
    no_climb = _determine_no_climb()
    cur = start_dir

    while cur:
        lst = os.listdir(cur)

        # Look for a lockfile – if it is valid we can stop walking
        if Options.lockfile in lst and _load_lockfile(cur):
            break

        # No lockfile – try to locate the wscript file
        if not Context.run_dir and Context.WSCRIPT_FILE in lst:
            Context.run_dir = cur

        # Move one level up unless we have been asked not to climb
        nxt = os.path.dirname(cur)
        if nxt == cur:
            break
        cur = nxt
        if no_climb:
            break

    # If we still have not found a run directory, handle help or abort
    if not Context.run_dir:
        if '-h' in sys.argv or '--help' in sys.argv:
            Logs.warn('No wscript file found: the help message may be incomplete')
            Context.run_dir = start_dir
            ctx = Context.create_context('options')
            ctx.curdir = start_dir
            ctx.parse_args()
            sys.exit(0)

        Logs.error('Waf: Run from a directory containing a file named %r' % Context.WSCRIPT_FILE)
        sys.exit(1)


def _change_to_run_dir():
    """Change the current working directory to Context.run_dir."""
    try:
        os.chdir(Context.run_dir)
    except OSError:
        Logs.error('Waf: The folder %r is unreadable' % Context.run_dir)
        sys.exit(1)


def _load_main_module():
    """Load the project's wscript file as the main module."""
    try:
        set_main_module(Context.run_dir + os.sep + Context.WSCRIPT_FILE)
    except Errors.WafError as e:
        Logs.pprint('RED', e.verbose_msg)
        Logs.error(str(e))
        sys.exit(1)
    except Exception as e:
        Logs.error('Waf: The wscript in %r is unreadable' % Context.run_dir, e)
        traceback.print_exc(file=sys.stdout)
        sys.exit(2)


def _run_all_commands():
    """Parse command‑line options and execute the requested waf commands."""
    try:
        run_commands()
    except Errors.WafError as e:
        if Logs.verbose > 1:
            Logs.pprint('RED', e.verbose_msg)
        Logs.error(e.msg)
        sys.exit(1)
    except SystemExit:
        raise
    except Exception as e:
        traceback.print_exc(file=sys.stdout)
        sys.exit(2)
    except KeyboardInterrupt:
        Logs.pprint('RED', 'Interrupted')
        sys.exit(68)


# ----------------------------------------------------------------------
# Main entry point – now a thin orchestrator that delegates work.
# ----------------------------------------------------------------------
def waf_entry_point(current_directory, version, wafdir):
    """Entry point used by the generated waf script."""
    Logs.init_log()

    # 1. version sanity check
    _check_waf_version(version)

    # 2. handle the special '--version' flag early
    _handle_version_argument(current_directory)

    # 3. initialise global paths
    Context.waf_dir = wafdir
    Context.launch_dir = current_directory

    # 4. locate the project root (run_dir) and possibly top/out dirs
    _find_run_directory(current_directory)

    # 5. switch to the project directory
    _change_to_run_dir()

    # 6. load the project's wscript as a module
    _load_main_module()

    # 7. finally, run the requested commands
    _run_all_commands()


def set_main_module(file_path):
    Context.g_module = Context.load_module(file_path)
    Context.g_module.root_path = file_path

    def set_def(obj):
        name = obj.__name__
        if not name in Context.g_module.__dict__:
            setattr(Context.g_module, name, obj)

    for k in [update, dist, distclean, distcheck, update]:
        set_def(k)
    if not 'init' in Context.g_module.__dict__:
        Context.g_module.init = Utils.nada
    if not 'shutdown' in Context.g_module.__dict__:
        Context.g_module.shutdown = Utils.nada
    if not 'options' in Context.g_module.__dict__:
        Context.g_module.options = Utils.nada


def parse_options():
    Context.create_context('options').execute()
    if not Options.commands:
        Options.commands = [default_cmd]
    Options.commands = [x for x in Options.commands if x != 'options']
    Logs.verbose = Options.options.verbose
    Logs.init_log()
    if Options.options.zones:
        Logs.zones = Options.options.zones.split(',')
        if not Logs.verbose:
            Logs.verbose = 1
    elif Logs.verbose > 0:
        Logs.zones = ['runner']
    if Logs.verbose > 2:
        Logs.zones = ['*']


def run_command(cmd_name):
    ctx = Context.create_context(cmd_name)
    ctx.log_timer = Utils.Timer()
    ctx.options = Options.options
    ctx.cmd = cmd_name
    ctx.execute()
    return ctx


def run_commands():
    parse_options()
    run_command('init')
    while Options.commands:
        cmd_name = Options.commands.pop(0)
        ctx = run_command(cmd_name)
        Logs.info('%r finished successfully (%s)' % (cmd_name, str(ctx.log_timer)))
