"""
Container selection utilities.

The original ``ContainerFinder`` implementation performed a monolithic series of
checks to locate a suitable container for a job.  This version refactors that
logic using the *Strategy* pattern – each distinct way of locating a container
is encapsulated in its own ``ContainerSelectionStrategy`` implementation.  The
``ContainerFinder`` class now merely delegates to a strategy that can be chosen
dynamically (e.g. via a destination configuration key).

The public behaviour of the module is unchanged – callers still invoke
``ContainerFinder.find_container`` and receive either a concrete container
instance or ``NULL_CONTAINER``.
"""

from abc import ABCMeta, abstractmethod
import os
import string

from galaxy.util import asbool
from ..deps import docker_util

import logging

log = logging.getLogger(__name__)

DEFAULT_CONTAINER_TYPE = "docker"


