# --------------------------------------------------------------------------- #
class ContainerSelectionStrategy(object):
    """Abstract base for all container‑selection strategies."""
    __metaclass__ = ABCMeta

    @abstractmethod
    def select_container(self, tool_info, destination_info, job_info):
        """
        Return a concrete ``Container`` instance or ``NULL_CONTAINER``.
        """


class BaseContainerStrategy(ContainerSelectionStrategy):
    """
    Common utilities shared by concrete strategies.
    """
    def __init__(self, app_info):
        self.app_info = app_info
        self.container_registry = ContainerRegistry()

    # ------------------------------------------------------------------- #
    #  Helper methods (mirrored from the original implementation)        #
    # ------------------------------------------------------------------- #
    def _container_type_enabled(self, container_type, destination_info):
        return asbool(destination_info.get("%s_enabled" % container_type, False))

    def _overridden_container_id(self, container_type, destination_info):
        if not self._container_type_enabled(container_type, destination_info):
            return None
        return destination_info.get("%s_container_id_override" % container_type)

    def _default_container_id(self, container_type, destination_info):
        if not self._container_type_enabled(container_type, destination_info):
            return None
        return destination_info.get("%s_default_container_id" % container_type)

    def _build_container(self, container_id, container_type,
                         tool_info, destination_info, job_info):
        if not self._container_type_enabled(container_type, destination_info):
            return NULL_CONTAINER
        return CONTAINER_CLASSES[container_type](
            container_id, self.app_info, tool_info, destination_info, job_info
        )


# ------------------------------------------------------------------- #
#  Concrete strategies – each corresponds to a block of the old code #
# ------------------------------------------------------------------- #
class OverriddenContainerStrategy(BaseContainerStrategy):
    """Select a container that the destination explicitly forces."""
    def select_container(self, tool_info, destination_info, job_info):
        for container_type in CONTAINER_CLASSES.keys():
            container_id = self._overridden_container_id(container_type, destination_info)
            if container_id:
                container = self._build_container(
                    container_id, container_type,
                    tool_info, destination_info, job_info
                )
                if container:
                    return container
        return NULL_CONTAINER


class ToolDeclaredContainerStrategy(BaseContainerStrategy):
    """Select a container declared directly on the tool."""
    def select_container(self, tool_info, destination_info, job_info):
        for container_description in tool_info.container_descriptions:
            container = self._build_container(
                container_description.identifier,
                container_description.type,
                tool_info, destination_info, job_info
            )
            if container:
                return container
        return NULL_CONTAINER


class RequirementBasedContainerStrategy(BaseContainerStrategy):
    """Select a container that satisfies the tool's requirements."""
    def select_container(self, tool_info, destination_info, job_info):
        container_descriptions = self.container_registry.container_descriptions_for_requirements(
            tool_info.requirements
        )
        for container_description in container_descriptions:
            container = self._build_container(
                container_description.identifier,
                container_description.type,
                tool_info, destination_info, job_info
            )
            if container:
                return container
        return NULL_CONTAINER


class DefaultContainerStrategy(BaseContainerStrategy):
    """Fall back to a destination‑defined default container."""
    def select_container(self, tool_info, destination_info, job_info):
        for container_type in CONTAINER_CLASSES.keys():
            container_id = self._default_container_id(container_type, destination_info)
            if container_id:
                container = self._build_container(
                    container_id, container_type,
                    tool_info, destination_info, job_info
                )
                if container:
                    return container
        return NULL_CONTAINER


class CompositeContainerStrategy(ContainerSelectionStrategy):
    """
    Executes a list of strategies in order, returning the first non‑null
    container.  This mirrors the sequential checks performed in the original
    ``ContainerFinder.find_container`` implementation.
    """
    def __init__(self, strategies):
        self.strategies = strategies

    def select_container(self, tool_info, destination_info, job_info):
        for strategy in self.strategies:
            container = strategy.select_container(tool_info, destination_info, job_info)
            if container is not NULL_CONTAINER:
                return container
        return NULL_CONTAINER


# --------------------------------------------------------------------------- #
#  Public façade – ContainerFinder                                            #
# --------------------------------------------------------------------------- #
class ContainerFinder(object):
    """
    Facade that delegates container selection to a configurable strategy.

    The strategy can be supplied explicitly when constructing the finder.
    If omitted, a default ``CompositeContainerStrategy`` is built that
    reproduces the historic behaviour:

        1. Destination‑forced overrides
        2. Tool‑declared containers
        3. Requirement‑based containers
        4. Destination defaults
    """

    def __init__(self, app_info, strategy=None):
        self.app_info = app_info
        if strategy is None:
            # Build the default composite strategy.
            self.strategy = CompositeContainerStrategy([
                OverriddenContainerStrategy(app_info),
                ToolDeclaredContainerStrategy(app_info),
                RequirementBasedContainerStrategy(app_info),
                DefaultContainerStrategy(app_info),
            ])
        else:
            self.strategy = strategy

    def find_container(self, tool_info, destination_info, job_info):
        """
        Return a concrete container instance or ``NULL_CONTAINER``.
        """
        return self.strategy.select_container(tool_info, destination_info, job_info)


